import { Layout  } from 'antd';
import Header from './header';
import Carousel from '../components/carousel';

const Index = () => {
  return(
    <Layout>
    <Header />

    <Row justify="space-around" type="flex">
         <Col span={24} className="carousel mb-50">
       <Carousel/>
    </Col>
</Row>

  </Layout> 
  )
}


export default Index;
